import React from 'react'

export default function Header() {
    return (
        <div className="MuiBox-root jss462 jss441"><div className="MuiBox-root jss463 jss442"><div className="MuiContainer-root MuiContainer-maxWidthLg" bgcolor="primary.light"><div className="MuiBox-root jss464 jss443"><div className="MuiBox-root jss465 jss444"><a aria-current="page" className="active" href="/"><img src="data:image/png;base64," alt="logo" /></a></div><div className="MuiBox-root jss466 jss445"><ul><li><a className="MuiTypography-root MuiLink-root MuiLink-underlineNone MuiTypography-subtitle1 MuiTypography-colorPrimary">Lịch Chiếu</a></li><li><a className="MuiTypography-root MuiLink-root MuiLink-underlineNone MuiTypography-subtitle1 MuiTypography-colorPrimary">Cụm Rạp</a></li><li><a className="MuiTypography-root MuiLink-root MuiLink-underlineNone MuiTypography-subtitle1 MuiTypography-colorPrimary">Tin Tức</a></li><li><a className="MuiTypography-root MuiLink-root MuiLink-underlineNone MuiTypography-subtitle1 MuiTypography-colorPrimary">Ứng dụng</a></li></ul></div><div className="MuiBox-root jss467"><div className="MuiBox-root jss468 jss447"><div className="MuiBox-root jss469 jss450"><button className="MuiButtonBase-root MuiButton-root MuiButton-text jss449" tabIndex={0} type="button"><span className="MuiButton-label"><img src="https://i.pravatar.cc/150?u=asuka1997" alt="avatar" /><p className="MuiTypography-root MuiTypography-body1">asuka1997</p></span><span className="MuiTouchRipple-root" /></button></div></div><div className="MuiBox-root jss470 jss448"><a className="MuiTypography-root MuiLink-root MuiLink-underlineNone jss446 MuiTypography-colorPrimary" href="#"><img src="data:image/png;base64," alt="location" /><span className="MuiTypography-root MuiTypography-body1">Hồ Chí Minh</span></a></div></div></div></div></div></div>
    )
}
